    constructDate(dateInMillisecond) {
        const date = new Date(dateInMillisecond);
        return `${date.getFullYear()}-${this.appendZero(date.getMonth() + 1)}-${this.appendZero(date.getDate())}`;
    }
    // Append zero for single digit Date and Month
    appendZero(n) {
        if (n < 10) {
            return '0' + n;
        }
        return '' + n;
    }
