class ViewAttendanceComponent {
    constructor(api, route, location) {
        this.api = api;
        this.route = route;
        this.location = location;
        this.present = 0;
        this.absent = 0;
        this.total = 0;
    }
    ngOnInit() {
        this.display = false;
        this.noAttendanceData = 'Select Course';
        this.instituteId = this.route.snapshot.paramMap.get('id');
        this.route.queryParams.subscribe((data) => {
            this.studentId = data.student;
        });
        this.attendance = [];
        this.courses = [];
        if (this.studentId) {
            this.getCourses(this.instituteId, this.studentId);
        }
        else {
            this.location.back();
        }
    }
    getCourses(instituteId, studentId) {
        this.api.getCoursesOfStudentByInstitute({ _id: studentId, instituteId }).subscribe((res) => {
            this.courses = [];
            res.forEach((course) => {
                this.courses.push(course.courses.course);
            });
            this.display = true;
        }, (err) => { });
    }
    onSelectCourse(id) {
        if (id !== '') {
            this.getAttendance(id);
        }
    }
    getAttendance(courseId) {
        this.api
            .getStudentAttendanceByCourse({
            studentId: this.studentId,
            instituteId: this.instituteId,
            courseId,
        })
            .subscribe((res) => {
            this.total = res.length;
            this.present = 0;
            this.absent = 0;
            this.attendance = [];
            if (this.total === 0) {
                this.noAttendanceData = 'No Attendance Found';
            }
            else {
                res.sort((a1, a2) => {
                    if (new Date(a1.date).getTime() >= new Date(a2.date).getTime()) {
                        return 1;
                    }
                    else {
                        return -1;
                    }
                });
                res.forEach((atten) => {
                    const newAtten = {
                        date: this.getScheduleDate(atten.date),
                        status: atten.attendance.attendanceStatus,
                    };
                    this.attendance.push(newAtten);
                    if (newAtten.status) {
                        this.present += 1;
                    }
                    else {
                        this.absent += 1;
                    }
                });
            }
        }, (err) => { });
    }
    getScheduleDate(date) {
        const d = date.split('-');
        return `${d[2]}-${d[1]}-${d[0]}`;
    }
}


