class ManageLeadComponent {
    constructor(api, router, route, toasterService) {
        this.api = api;
        this.router = router;
        this.route = route;
        this.toasterService = toasterService;
        this.upcomingLeads = [];
        this.lostLeads = [];
        this.courses = [];
        this.months = [
            'JAN',
            'FEB',
            'MAR',
            'APR',
            'MAY',
            'JUN',
            'JUL',
            'AUG',
            'SEP',
            'OCT',
            'NOV',
            'DEC',
        ];
    }
    ngOnInit() {
        this.instituteId = this.route.snapshot.paramMap.get('id');
        this.getLeads();
        this.getCourses();
    }
    getCourses() {
        this.api.getCourseTD(this.instituteId).subscribe((data) => {
            this.courses = data.course;
        }, (err) => console.error(err));
    }
    getCourseName(id) {
        const course = this.courses.find((curCourse) => curCourse._id === id);
        if (course) {
            return course.name;
        }
        return '';
    }
    onSelectCourse(courseId) {
        this.selectedCourseId = courseId;
        this.getLeads();
    }
    getFormattedDate(date) {
        const d = date.split('-');
        return `${d[2]}-${d[1]}-${d[0]}`;
    }
    getLeads() {
        this.upcomingLeads = [];
        this.lostLeads = [];
        this.api
            .getLeadsByOfInstitute({
            instituteId: this.instituteId,
            status: this.selectedStatus,
            courseId: this.selectedCourseId,
        })
            .subscribe((data) => {
            data.forEach((lead) => {
                if (lead.status === 'OPEN') {
                    this.upcomingLeads.push(lead);
                }
                else {
                    this.lostLeads.push(lead);
                }
            });
        });
    }
    view(id) {
        this.router.navigate([`/pages/institute/view-lead/${this.instituteId}`], {
            queryParams: { leadId: id },
        });
    }
    edit(id) {
        this.router.navigate([`/pages/institute/add-leads/${this.instituteId}`], {
            queryParams: { leadId: id, edit: true },
        });
    }
    deleteLostLead(id, index) {
        this.api.deleteLead({ _id: id }).subscribe(() => {
            this.lostLeads.splice(index, 1);
            this.showToast('top-right', 'success', 'Lead Deleted Successfully');
        }, (err) => console.error(err));
    }
    getMonth(date) {
        const month = date.split('-')[1];
        return this.months[+month - 1];
    }
    getDay(date) {
        return date.split('-')[2];
    }
    deleteUpcomingLead(id, index) {
        this.api.deleteLead({ _id: id }).subscribe(() => {
            this.upcomingLeads.splice(index, 1);
            this.showToast('top-right', 'success', 'Lead Deleted Successfully');
        }, (err) => console.error(err));
    }
    addLead() {
        this.router.navigate([`/pages/institute/add-leads/${this.instituteId}`]);
    }
    showToast(position, status, message) {
        this.toasterService.show(status, message, { position, status });
    }
}


