class ManageScheduleComponent {
    constructor(router, api, scheduleService, toasterService, active) {
        this.router = router;
        this.api = api;
        this.scheduleService = scheduleService;
        this.toasterService = toasterService;
        this.active = active;
        this.batches = [];
        this.schedules = [];
        this.months = [
            'JAN',
            'FEB',
            'MAR',
            'APR',
            'MAY',
            'JUN',
            'JUL',
            'AUG',
            'SEP',
            'OCT',
            'NOV',
            'DEC',
        ];
    }
    ngOnInit() {
        this.display = false;
        this.courseId = 'all';
        this.instituteId = this.active.snapshot.paramMap.get('id');
        this.getCourses(this.instituteId);
        this.onSelectCourse('all');
    }
    getCourses(id) {
        this.api.getCourseTD(id).subscribe((data) => {
            this.institute = data;
            this.display = true;
        });
    }
    getMonth(date) {
        const month = date.split('-')[1];
        return this.months[+month - 1];
    }
    getDay(date) {
        return date.split('-')[2];
    }
    time(time) {
        const hour = +time.split(':')[0];
        const min = time.split(':')[1];
        let t = '';
        if (hour > 12) {
            t = (hour - 12).toString() + ':' + min + ' PM';
        }
        else {
            t = hour.toString() + ':' + min + ' AM';
        }
        return t;
    }
    onSelectCourse(id) {
        this.courseId = id;
        if (id === 'all') {
            this.getSchedules({ instituteId: this.instituteId });
        }
        else {
            this.batchId = 'all';
            this.batches = this.institute.batch.filter((b) => b.course === id);
            this.onSelectBatch(this.batchId);
        }
    }
    onSelectBatch(id) {
        if (id === 'all') {
            this.getSchedules({ instituteId: this.instituteId, courseId: this.courseId });
        }
        else {
            this.getSchedules({ instituteId: this.instituteId, courseId: this.courseId, batchId: id });
        }
    }
    addSchedule() {
        this.router.navigate(['/pages/institute/add-schedule', this.instituteId]);
    }
    getSchedules(data) {
        this.scheduleService.getScheduleByInstitute(data).subscribe((res) => {
            this.schedules = res;
        });
    }
    viewSchedule(code) {
        this.router.navigate(['/pages/institute/view-schedule', this.instituteId], {
            queryParams: { schedule: code },
        });
    }
    getScheduleDate(date) {
        const d = date.split('-');
        return `${d[2]}-${d[1]}-${d[0]}`;
    }
    editSchedule(code) {
        this.router.navigate(['/pages/institute/edit-schedule', this.instituteId], {
            queryParams: { schedule: code, edit: 'true' },
        });
    }
    deleteSchedule(code) {
        const confirm = window.confirm('Are u sure, You want to Delete this Schedule?');
        if (confirm) {
            this.scheduleService.deleteSchedule(code).subscribe((res) => {
                const i = this.schedules.findIndex((s) => s._id === code);
                this.schedules.splice(i, 1);
                this.showToast('top-right', 'success', 'Schedule Deleted Successfully!');
            }, (err) => {
                this.showToast('top-right', 'danger', err.error.message);
            });
        }
    }
    showToast(position, status, message) {
        this.toasterService.show(status, message, {
            position,
            status,
        });
    }
}


